import React from 'react';
import img from '../../images/image 1.png';
import { faCoffee } from '@fortawesome/free-solid-svg-icons';
import "./LeagueList.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const LeagueList = (props) => {
    // console.log(props);
    const {strLeague, strSport} = props.league;
    console.log(strLeague);
    return (
        
        <div className="col-12 col-md-6 col-lg-4">
            <div className="card mb-5">
                <img src={img} className="card-img-top" alt=""/>
                <div className="card-body">
                    <h5 className="card-title">{strLeague}</h5>
                    <p className="card-text">Sports type: {strSport}</p>
                </div>
                <div className="footer-card">
                    <a href="/name" className="btn btn-custom px-3 mt-3  fw-bold text-white ms-3">
                        Explore
                        <FontAwesomeIcon icon={faCoffee} className="ml-3"></FontAwesomeIcon>
                    </a>
                </div>
            </div>
        </div>
    );
};

export default LeagueList;
